 // TOP LEFT\r\n        if (!phylo.settings.phylostratigraphy) {\r\n            if (this.container_object.models.length > 0) {\r\n                this.add_toggle()\r\n            }\r\n            this.add_data_icon()\r\n        }\r\n\r\n        // TOP RIGHT\r\n        this.add_search()\r\n        this.add_export()\r\n        this.add_settings()\r\n        this.add_undo()\r\n\r\n        // COLOR LEGEND\r\n        if (phylo.settings.compareMode || this.viewer.model.settings.style.color_accessor !== null){\r\n            this.add_color_legend()\r\n        }\r\n\r\n        // Add Stack\r\n        if (this.viewer.model.settings.has_histogram_data && this.viewer.model.settings.show_histogram){\r\n\r\n            this.add_histogram_legend();\r\n\r\n        }\r\n\r\n\r\n\r\n    }\r\n\r\n    // PLACEHOLDER\r\n    add_bottom_left_container() {\r\n        return this.container_d3.append(\"div\")\r\n            .attr(\"class\",\"corner_placeholder bottom left\")\r\n            .style(\"flex-direction\",  \"column\")\r\n    }\r\n    add_bottom_right_container(){\r\n        return this.container_d3.append(\"div\")\r\n            .attr(\"class\",\"corner_placeholder bottom right\")\r\n            .style(\"flex-direction\",  \"column\")\r\n            .style( \"align-items\", \"flex-end\")\r\n    }\r\n    add_top_left_container(){\r\n        return this.container_d3.append(\"div\")\r\n            .attr(\"class\",\"corner_placeholder top left\")\r\n    }\r\n    add_top_right_container(){\r\n        var div =  this.container_d3.append(\"div\").attr(\"class\",\"corner_placeholder top right\")\r\n            .style(\"flex-direction\",'column')\r\n            .style(\"align-items\",'end')\r\n\r\n        this.tr_buttons = div.append(\"div\").attr(\"class\",\"tr-button\")\r\n\r\n        this.tr_menus = div.append(\"div\").attr(\"class\",\"tr-menus\")\r\n\r\n        return div\r\n    }\r\n\r\n    add_histogram_legend() {\r\n\r\n\r\n        d3__WEBPACK_IMPORTED_MODULE_1__.select('#histogram-legend').remove();\r\n\r\n        var width = 230;\r\n        var height = 80;\r\n        var svgHeight = height + 25;\r\n        var legendRectSize = 20;\r\n        var left_margin = 25;\r\n        var top_margin = 50;\r\n\r\n        if (phylo.settings.phylostratigraphy){\r\n            top_margin = 25;\r\n        }\r\n\r\n        var legendTxtSize = 13;\r\n        // center text in the middle of the legend colored rectangle, rounding it to smaller Y-value\r\n        var legendTxtYPadding = (legendRectSize + legendTxtSize) / 2\r\n\r\n        if(this.viewer.model.settings.stack.type == \"genes\"){\r\n            var dataLabels = [\"Gained\", \"Duplicated\", \"Retained\", \"Lost\" ]\r\n        } else {\r\n            var dataLabels = [\"Gains\", \"Duplications\", \"Losses\" ]\r\n        }\r\n\r\n        // to position legends correctly\r\n        var rects = dataLabels.length - 1;\r\n\r\n\r\n        var legendSvg = this.viewer.svg.append(\"svg\")\r\n            .attr(\"id\", \"histogram-legend\")\r\n            .attr(\"x\", left_margin)\r\n            .attr(\"y\", top_margin)\r\n            .attr(\"width\", width + \"px\")\r\n            .attr(\"height\", svgHeight + \"px\")\r\n            .append(\"g\")\r\n\r\n\r\n        legendSvg.append(\"line\")\r\n            .attr(\"x1\", 0)\r\n            .attr(\"y1\", rects * legendRectSize)\r\n            .attr(\"x2\", 200)\r\n            .attr(\"y2\", rects * legendRectSize)\r\n            .attr(\"class\", \"divline\")\r\n            .attr(\"stroke-width\", 2)\r\n            .attr(\"stroke\", \"black\");\r\n\r\n        legendSvg.selectAll('rect')\r\n            .data(dataLabels)\r\n            .enter()\r\n            .append('rect')\r\n            .attr('x', 110)\r\n            .attr('y', function(d, i){\r\n                return i * legendRectSize;\r\n            })\r\n            .attr('width', legendRectSize)\r\n            .attr('height', legendRectSize)\r\n            .attr('fill', (d, i, node) => {\r\n                return this.viewer.settings.stack.colorMap[d];\r\n            });\r\n\r\n        legendSvg.selectAll('text')\r\n            .data(dataLabels)\r\n            .enter()\r\n            .append('text')\r\n            .text(function(d){\r\n                return d;\r\n            })\r\n            .attr('x', 110 + legendRectSize + 5)\r\n            .attr('y', function(d, i){\r\n                return i * legendRectSize + legendTxtYPadding;\r\n            })\r\n            .attr('text-anchor', 'start')\r\n            .attr('alignment-baseline', 'baseline')\r\n            .attr(\"font-size\", legendTxtSize).attr(\"stroke\", \"black\");\r\n\r\n\r\n        legendSvg\r\n            .append('text')\r\n            .attr(\"class\", \"legendGeneTotal\")\r\n            .text(\"Total # of \"+this.viewer.model.settings.stack.type)\r\n            .attr('x', 0)\r\n            .attr('y', rects * legendRectSize - 5)\r\n            .attr('text-anchor', 'start')\r\n            .attr(\"font-size\", legendTxtSize).attr(\"stroke\", \"black\");\r\n\r\n        d3__WEBPACK_IMPORTED_MODULE_1__.selectAll(\".legendGeneTotal\").moveToFront();\r\n\r\n    }\r\n\r\n    // DATA ICON\r\n    add_data_icon(){\r\n\r\n        this.container_d3.select(\"#exampleModal\" + this.container_object.uid).remove()\r\n\r\n        var b = this.top_left.append('button')\r\n            .attr('class', ' square_button dashed_button')\r\n            .attr('id', 'buttonmodal_' + this.container_object.div_id )\r\n            .style('margin', '2px')\r\n            .attr('data-bs-toggle', 'modal')\r\n            .attr('data-bs-target', '#exampleModal' + this.container_object.uid)\r\n            .attr('data-bs-placement', 'right')\r\n            .attr('title', 'Add a new tree')\r\n            .append(\"div\")\r\n            .attr(\"class\",\"label\")\r\n\r\n            b.html(\"  <i class='fas fa-plus' style='color:#888'></i> Add tree\")\r\n\r\n\r\n        if (this.tooltip_add_tree){\r\n            this.tooltip_add_tree.tip.rem